INSERT INTO `shop_site_content` VALUES ('1','document','text/html','Главная','','','index.php','','1','0','0','0','0','','<section data-href=\'\' id=\'banner\'>\n	<h2>Столовый набор «Карин»</h2>\n	<h4><b>Лидер продаж месяца</b> радует глаз. Для знающих толк в посуде</h4>\n</section>\n<section class=\'items\'>\n	<h2><a href=\'\'>Лучшие цены</a></h2>\n	<ul>\n		<li><figure>\n			<img src=\'assets/images/02934_0.jpg\'/>\n			<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n		<li><figure>\n			<img src=\'assets/images/c81155.jpg\'/>\n			<figcaption><a href=\'\'>Ящик ПРИНЦЕССЫ/ФЕИ DISNEY 15л</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n		<li><figure>\n			<img src=\'assets/images/G0670_0.jpg\'/>\n			<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n		<li><figure>\n			<img src=\'assets/images/tal1083.jpg\'/>\n			<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n		<li><figure>\n			<img src=\'assets/images/TAL1606.jpg\'/>\n			<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n		<li><figure>\n			<img src=\'assets/images/BK-8A.jpg\'/>\n			<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n			</figure></li>\n	</ul>\n</section>\n<section>\n	<h2>У нас покупают</h2>\n	  [!Ditto?\n	    &outerTpl=`@CODE: <div class=\'grid3\'><ul>[+ditto+]</ul></div>`\n		&where=`template=6`\n      	&depth=`0`\n		&filter=`image,[],2`\n		&parents=`2`\n		&randomize=`1`\n		&display=`4`\n		&tpl=`index-sections`\n		&orderBy=`menuindex ASC`\n	  !]\n\n</section>\n<section>\n	<h1>Тематические товары: всё для дома и уюта.</h1>\n	<p>Дорогой покупатель, мы очень ценим Ваш выбор и благодарим за посещение ttstore.ru - нашего интернет-магазина посуды, кухонной утвари, товаров для дома и прочей тематической атрибутики. Сомневаетесь в выборе? Позвоните по нашей горячей линии и наши менеджеры помогут подобрать товар который ждет именно Вас. Здесь Вы найдете изделия как для повседневной жизни, так и на праздники. В наших каталогах представлены такие бренды, как Luminarc и Domenik - лидеры в отрасли посуды, Attribute - самые качественные и товары для дома, Curver - жаропрочная посуда, а также Walter Glass и прочие.</p>\n</section>\n    \n<section class=\'grid3\'>\n	<ul>\n		<li>\n			<h2><a href=\'\'><img src=\'assets/templates/default/images/ico-adv-award.png\'/><br/>Отличное качество</a></h2>\n			<p>Только в нашем интернет-магазине Вы сможете купить посуду бренда Luminarc по самым выгодным ценам. Если Вы задались целью приобрести себе пару новых тарелок, или заказать целый столовый сервиз, рекомендуем Вам именно этот бренд. Также хотим заострить внимание на продуктах CRISTAL D\'ARQUES - бренда, который впервые наладил выпуск французского хрусталя в мировом производстве.</p>\n		</li>\n		<li>\n			<h2><a href=\'\'><img src=\'assets/templates/default/images/ico-adv-multichoise.png\'/><br/>Огромный выбор</a></h2>\n			<p>Наш ассортимент насчитывает более 15 тысяч товаров и не ограничивается товарами для кухни или дома. Именно у нас Вы сможете купить всё для поездки на шашлыки и барбекю, подготовиться к любому празднику, будь то Новый год или День рождения. Мы поможем сделать Ваш дом еще уютнее, скрасив повседневный быт яркими, долговечными и качественными продуктами.</p>\n		</li>\n		<li>\n			<h2><a href=\'\'><img src=\'assets/templates/default/images/ico-adv-checkus.png\'/><br/>Следите за обновлениями!</a></h2>\n			<p>Корзины для белья, вешалки, гладильные доски, сушилки и прочие необходимые в быту товары - все это Вы сможете найти у нас на витринах. И, конечно же, наш магазин заботится о Ваших улыбках, и не забывает ежедневно обновлять свой ассортимент а также делать регулярные скидки! Не пропустите свою: акции проводятся каждый день. <a class=\'vibrate_subscribe\' href=\'#\'>Я хочу получать выгодные предложения на свой e-mail.</a></p>\n		</li>\n	</ul>\n</section>\n\n<section id=\'reviews\'>\n	<h2>Отзывы покупателей</h2>\n	<figure>\n		<p>Заказывала <a href=\'.\'>декантер для вина</a>. Оформила заказ. На следующий день выяснилось, что товара нет на складе. Оператор сразу же принес извинения и сказал, что как только товар появится в наличии, мне сразу же сообщат. Буквально через день мне отзвонились и сказали, что товар снова в наличии. На следующий же день мне привезли декантер. Курьер позвонил уже в 9-30 и в 10-30 подъехал с товаром. От магазина остались очень приятные впечатления! Вежливые операторы. Оперативный и доброжелательный курьер. Магазин отличный! Качество товара на высоте. Рекомендую всем и сама, при необходимости буду заказывать именно в этом магазине</p>\n		<i class=\'stars four\'></i>\n		<figcaption>Байдин Артем</figcaption>\n	</figure><figure>\n	<p>Заказывала декантер для вина. Оформила заказ. На следующий день выяснилось, что товара нет на складе. Оператор сразу же принес извинения и сказал, что как только товар появится в наличии, мне сразу же сообщат. Буквально через день мне отзвонились и сказали, что товар снова в наличии. На следующий же день мне привезли декантер. Курьер позвонил уже в 9-30 и в 10-30 подъехал с товаром. От магазина остались очень приятные впечатления! Вежливые операторы. Оперативный и доброжелательный курьер. Магазин отличный! Качество товара на высоте. Рекомендую всем и сама, при необходимости буду заказывать именно в этом магазине</p>\n	<i class=\'stars four\'></i>\n	<figcaption>Байдин Артем</figcaption>\n	</figure><figure>\n	<p>Заказывала декантер для вина. Оформила заказ. На следующий день выяснилось, что товара нет на складе.