INSERT INTO `shop_site_content` VALUES ('17','document','text/html','Товары для кухни','','','kitchen','','1','0','0','2','1','','<section>\n<h2>Главное место в любом доме!</h2>\n\n<p>Согласно нашим культурным традициям кухня — это не просто место для приготовления пищи или вспомогательное помещение. Здесь семья не только завтракает, обедает и ужинает — здесь проходят семейные советы. Хотя сегодня мы можем позволить себе обедать в столовой, а гостей принимать в гостиной, излюбленным местом общения по-прежнему остается кухня.</p>\n\n<h3>Приготовление - одно удовольствие!</h3>\n<p>В разделе «Товары для кухни» Вас ожидает большой выбор кухонных принадлежностей и аксессуаров. Здесь Вы без труда найдете достойный подарок, который всегда пригодится в хозяйстве. Товары для дома и кухни необходимы всем. Это делает рынок их изготовления динамично развивающимся и всегда находящимся в фаворе. Единственное, что волнует производителей, это быть «в теме», чувствовать настрой покупателей и их потребности, чтобы с максимальной скоростью удовлетворить их.</p>\n\n<h3>Красивые аксессуары и наборы для приема пищи.</h3>\n<p>Радость для хозяйки  – красивые и симпатичные газовые зажигалки, соусницы, формочки для льда, сушилки для посуды, подставки под горячее и т.д. Столовые приборы придают шика любому праздничному столу. По красоте и изяществу столовую посуду, изысканность сервировки блюд можно сравнить с одеждой для человека – и то, и другое одинаково важно. Поэтому необходимо поработать над внешним видом стола, с помощью нашего интернет-магазина вы с успехом сможете это сделать.</p>\n\n<p>Штопоры и открывалки сейчас настолько популярны, что их модифицируют, чтобы сделать процесс откупоривания сделать максимально быстрым, безопасным и качественным. Без этих предметов чрезвычайно сложно добраться до содержимого бутылки или банки. Электрические штопоры и безопасные открывалки из нержавейки добавят интересную нотку вашей вечеринке, удивите друзей!</p>\n</section>','1','4','0','1','1','1','1436196185','1','1436274031','0','0','0','1436196185','1','Кухня','0','0','0','0','0','0','0','1');
INSERT INTO `shop_site_content` VALUES ('18','document','text/html','Столовая посуда','','','dining','','1','0','0','2','1','','<section>\n<h2>Где вся семья в сборе</h2>\n<p>В мечтах, пожалуй, каждой семьи есть место столовой  - комнате в большом загородном доме, где по вечерам за ужином в теплой атмосфере будет собираться вся семья и гости. Кстати, идея выделять самую большую и светлую комнату под столовую пользовалась популярностью в нашей стране вплоть до революции 1917 года. По обычаю, в центре помещения ставился огромный стол с белоснежной скатертью, за который садились гости и хозяева. Постепенно со строительством многоэтажных домов, выделять отдельную комнату под место для принятия пищи стало невозможно. И, сегодня  на смену традиционным столовым пришли кухни – столовые, которые позволяют совмещать в себе гостиную, место для приготовления пищи и барную стойку. </p>\n<p>Как видим, обычаи поменялись, но традиция ставить на стол самую красивую посуду в доме осталась неизменной. Вместе с этим усовершенствовались сами столовые наборы, предметы сервировки стола, а также барная посуда. Разнообразие ассортимента современных столовых атрибутов поражает, а функциональность и удобство использования порадует даже самых привередливых гурманов. Так, только одних стаканов появились великое множество: для каждого напитка – свой бокал. И, это не просто дань моде: форма и линии каждого из бокалов помогают полностью раскрыть вкус и аромат именно этого напитка.</p>\n</section>','1','4','1','1','1','1','1436272758','1','1439085292','0','0','0','1436272758','1','Столовая','0','0','0','0','0','0','0','1');
INSERT INTO `shop_site_content` VALUES ('19','document','text/html','Товары для дома','','','home','','1','0','0','2','1','','<section>\n<h2>Мой дом – моя крепость</h2>\n<p>Устроить свой быт практически невозможно без полезных, функциональных и красивых товаров для дома. Все-таки сложно представить себе современную жизнь человека без этих приятных мелочей, полезных товаров и аксессуаров - таких красивых, стильных, разнообразных и многофункциональных. </p>\n<p>Согласитесь, что после покупки гардероба его нужно укомплектовать вешалками, а в ванной или на балконе следует предусмотреть сушилку для одежды. Мы поможем Вам в этом, ведь в нашем ассортименте есть все, что вам необходимо:\n<ul>\n<li>сетки для глажения;</li>\n<li>ящики для инструментов; </li>\n<li>сушилки для белья;</li>\n<li>коробки для хранения полезных мелочей;</li>\n<li>удобные корзины для белья</li>\n</ul>\n</p>\n<p>Этот список можно продолжать еще и еще, однако, как говорится, лучше один раз увидеть, чем сто раз услышать. Загляните в наш каталог и вы найдете для себя все необходимые товары для дома, а также красивые и полезные аксессуары, которые будут являться приятным дополнением к ним. Сделайте свою жизнь проще и красивее! </p>\n<p>У нас вы найдете широкий выбор полезных и недорогих товаров для дома. Добро пожаловать в разделы нашего онлайн-каталога, где вы можете посмотреть и недорого купить все самое необходимое. Участвуйте в наших акциях и закажите полезные товары для дома или дачи по доступным ценам. Экономьте ваше драгоценное время на походы по магазинам, и делайте покупки, не вставая с дивана, тем более что доставка по Москве осуществляется бесплатно.\n</p>\n</section>','1','4','2','1','1','1','1436272775','1','1436274062','0','0','0','1436272775','1','Дом','0','0','0','0','0','0','0','1');
