INSERT INTO `shop_site_content` VALUES ('21','document','text/html','Товары для дачи и отдыха на природе','','','weekend','','1','0','0','2','1','','<h2>Дача — это отдых или обуза?</h2>\n<p>Весенне солнце все настойчивее напоминает россиянам о начале активного дачного сезона -  садоводства и огородничества, а оттаивающая земля манит и пробуждает древние инстинкты пахарей и сеятелей.</p>\n<p>Для городского жителя дача — это, конечно, и отдых, и возможность общения с природой  и труд в удовольствие. К тому же, это прекрасная возможность для пребывания всей семьей на свежем воздухе. Дача — такое место, где даже детям будет интересно что-то вырастить самостоятельно.</p>\n','1','4','4','1','1','1','1436272830','1','1436274079','0','0','0','1436272830','1','Дача и отдых','0','0','0','0','0','0','0','1');
