INSERT INTO `shop_site_htmlsnippets` VALUES ('13','orderForm','','0','13','0','<form method=\"post\"  action=\"[~[*id*]~]\" id=\"orderForm\">\n  <input type=\"hidden\" name=\"subject\" value=\"Информация о заказе\" />\n\n  <section class=\'delivery\'>\n    <h3>Выбор доставки</h3>\n    <label><input name=\'delivery\' type=\'radio\' value=\"delivery\" /> Доставка по Москве и области - <b>[(price_delivery)] руб.</b> (за МКАД + 10руб./км.) </label>\n    <label><input name=\'delivery\' type=\'radio\' value=\"delivery_region\" /> Доставка по <a href=\'\' class=\'open-region-list\'>регионам</a> - <b>[(price_region)] руб.</b></label>\n    <label><input name=\'delivery\' type=\'radio\'  value=\"pickup\" /> Самовывоз - <b>[(price_pickup)] руб.</b></label>\n  </section>\n\n  <section class=\'city\'>\n    <h3>Город доставки</h3>\n    <label>\n      <select name=\'city\'>\n        <option value=\'\' disabled=\'disabled\'>Выберите город доставки</option>\n        <option value=\'Москва\'>Москва</option>\n        <option value=\'Санкт-Петербург\'>Санкт-Петербург</option>\n        <option value=\'Иваново\'>Иваново</option>\n        <option value=\'Калуга\'>Калуга</option>\n        <option value=\'Кострома\'>Кострома</option>\n        <option value=\'Орел\'>Орел</option>\n        <option value=\'Рязань\'>Рязань</option>\n        <option value=\'Тверь\'>Тверь</option>\n        <option value=\'Тула\'>Тула</option>\n        <option value=\'Ярославль\'>Ярославль</option>\n        <option value=\'Вологда\'>Вологда</option>\n        <option value=\'Ростов-на-Дону\'>Ростов-на-Дону</option>\n        <option value=\'Нижний Новгород\'>Нижний Новгород</option>\n        <option value=\'Екатеринбург\'>Екатеринбург</option>\n        <option value=\'Тюмень\'>Тюмень</option>\n        <option value=\'Челябинск\'>Челябинск</option>\n        <option value=\'Брянск\'>Брянск</option>\n        <option value=\'Владимир\'>Владимир</option>\n        <option value=\'ДРУГОЙ\'>Другой...</option>\n      </select>\n    </label>\n  </section>\n  <section>\n    <h3>Реквизиты компании</h3>\n	  <table>\n			<tr><td align=\'right\'><p>Название организации:</p></td><td><input name=\"companyName\" type=\"text\" eform=\"Организация::0\" /></td></tr>\n			<tr><td align=\'right\'><p>Юр. адрес:</p></td><td><input name=\"companyAddress\" type=\"text\" eform=\"::0\" /></td></tr>\n			<tr><td align=\'right\'><p>ИНН:</p></td><td><input name=\"companyInn\" type=\"text\" eform=\"::0\" /></td></tr>\n			<tr><td align=\'right\'><p>КПП:</p></td><td><input name=\"companyKpp\" type=\"text\" eform=\"::0\" /></td></tr>\n			<tr><td align=\'right\'><p>Расчетный счет №</p></td><td><input name=\"companyRs\" type=\"text\" eform=\"::0\" />	</td></tr>\n			<tr><td align=\'right\'><p>Банк:</p></td><td><input name=\"companyBank\" type=\"text\" eform=\"::0\" />	</td></tr>\n			<tr><td align=\'right\'><p>Корр. счет №:</p></td><td><input name=\"companyKrs\" type=\"text\" eform=\"::0\" /></td></tr>\n			<tr><td align=\'right\'><p>БИК:</p></td><td><input name=\"companyBik\" type=\"text\" eform=\"::0\" /></td></tr>\n		</table>\n  </section>\n	  [[Ditto?\n		&parents=`197`\n		&tpl=`@CODE: [+region+]`\n		&orderBy=`menuindex ASC`\n		&extenders=`distinct` &distinct=`region`\n	  ]]\n  <section class=\'pickup\'>\n    <h3>Пункты самовывоза</h3>\n    <label>\n	  [[Ditto?\n		&outerTpl=`@CODE: <select name=\'pickup\'>\n        <option value=\'\' disabled=\'disabled\'>Выберите пункт выдачи</option>\n		[+ditto+]</select>`\n		&parents=`197`\n		&tpl=`@CODE: <option value=\"[+menuindex+]\">[+pagetitle+] [+price+] руб.</option>`\n		&orderBy=`menuindex ASC`\n	  ]]\n    </label>\n  </section>\n\n  <section class=\'payment\'>\n    <h3>Способ оплаты</h3>\n    <label><input name=\'payment\' type=\'radio\' value=\"cash\" /> Наличными</label>\n    <label><input name=\'payment\' type=\'radio\' value=\"online\" /> Онлайн (VISA, MASTERCARD, QIWI, Яндекс.Деньги)</label>\n    <label><input name=\'payment\' type=\'radio\' value=\"bill\" /> Выставить счет</label>\n  </section>\n\n  <section>\n  <h3>Контактные данные</h3>\n  [+validationmessage+]\n  <table class=\'customerInfo\'>\n    <tr><td align=\'right\'><p><i>*</i>Ваше имя:</p></td><td><input class=\'req\' name=\"fullname\" size=\"30\" type=\"text\" eform=\"Имя::1\" /></td></tr>\n    <tr><td align=\'right\'><p><i>*</i>Телефон: +7 </p></td><td><input class=\'req\' name=\"phone\" size=\"14\" type=\"text\" eform=\"Телефон::1\" /></td></tr>\n    <tr>\n      <td align=\'right\'><p><i>*</i>E-mail:</p></td>\n      <td><input name=\"email\" size=\"25\" type=\"text\" eform=\"E-mail:email:0\" /><span> - на него мы вышлем информацию о заказе.</span></td>\n    </tr>\n    <tr><td align=\'right\'><p>Адрес:</p></td><td><textarea name=\"address\" cols=\'35\' rows=\'5\'  eform=\"Адрес::0\">[+comment+]</textarea></td></tr>\n  </table>\n  </section>\n  <section>\n    <h3>Дополнительная информация</h3>\n    <label>Промокод или купон: <input type=\"text\" name=\"coupon\"/></label>\n    <label>Время доставки: <input type=\"text\" name=\"time\" value=\'c 9-00 по 18-00\'/><span> - минимальный интервал 3 часа.</span></label>\n    <label><input type=\'checkbox\' value=\'subscribed\' name=\"subscribe\" eform=\"::0\"/> Получать информацию о акциях, новинках и выгодных предложениях</label>\n    <label><input type=\'checkbox\' value=\'1\' name=\"register\" eform=\"::0\"/> Возможно, я планирую повторные покупки</label>\n    <br/>\n    <label style=\'text-align:right\'><input type=\"submit\" name=\"submit\" class=\"button\" value=\"Оформить заказ\" /></label>\n  </section>\n</form>','0');
