INSERT INTO `shop_site_plugins` VALUES ('9','AJAX','','0','8','0','if(isset($_POST[\'selectors\']) && strtolower($_SERVER[\'HTTP_X_REQUESTED_WITH\']) == \'xmlhttprequest\'){\n//    if(!function_exists(\"file_get_html\")) include($modx -> config[ \'base_path\' ] . \'assets/snippets/scripts/htmlDom.class.php\');\n    if(!function_exists(\"file_get_html\")) include($modx -> config[ \'base_path\' ] . \'assets/php/libs/simple_html_dom.php\');\n    header(\'content-type: text/plain; charset=utf-8\');\n    $selectors = explode(\"|\", $_REQUEST[\'selectors\']);\n    $documentOutput = str_get_html($modx->documentOutput);\n\n    foreach ($selectors as $item){\n        $item = explode(\";\", $item);\n        $html = $documentOutput->find($item[1]);\n        $html = str_replace(array(\'\"\', \"\\r\\n\", \"\\r\", \"\\n\", \"\\t\"), array(\'\\\"\', \'\\n\', \'\\n\', \"\"), $html[0]);\n        $out .= \'\"\'.$item[0].\'\" : \"\'.$html.\'\",\'.\"\\n\";\n    }\n    $out .= \'\"title\" : \"\'.$modx->documentObject[\'pagetitle\'].\'. \'.$modx->config[\'site_name\'].\'.\"\';\n    exit(\"{\".$out.\"}\");\n\n}','0','','0',' ');
INSERT INTO `shop_site_plugins` VALUES ('10','Performance Info','','0','8','0','//<?\nif(strtolower($_SERVER[\'HTTP_X_REQUESTED_WITH\']) == \'xmlhttprequest\') return;\n$e = &$modx->Event;\nif($e->name == \'OnWebPageComplete\' && !empty($_SESSION[\'mgrShortname\'])){\n	\n	$ph = array(\n		\'executedQueries\' 	=> $modx->executedQueries?$modx->executedQueries:0,\n		\'queryTime\' 		=> sprintf(\"%2.4f\", $modx->queryTime),\n		\'memoryUsage\'		=> (memory_get_peak_usage(true) / 1024 / 1024),\n		\'phpTime\'			=> sprintf(\"%2.4f\", $modx->getMicroTime() - $modx->tstart - $modx->queryTime),\n		\'documentGenerated\'	=> $modx->documentGenerated?\"бд\":\"кеша\",\n		\'docid\'				=> $modx->documentIdentifier\n	);\n	while($replaced>0 || !isset($replaced)){\n		$tpl = str_replace(\n			array_map(function ($str){ return \'[+\'.(string)$str.\'+]\'; }, array_keys($ph)),\n			array_values($ph), $tpl, $replaced\n		);\n  	}\n	echo urldecode($tpl);\n}\n','0','&tpl=Шаблон вывода;textarea;<div id%3D\'log\'>\n  <span class%3D\'query\'><u>MySQL</u>: [+executedQueries+] за [+queryTime+]</span>\n  <span class%3D\'time\'><u>PHP</u>: [+memoryUsage+]MB за [+phpTime+],  из [+documentGenerated+]</span>\n  <span><a href%3D\'manager/index.php?a%3D27%26id%3D[+docid+]%26quickmanager%3D1\'>Открыть в ModX</a></span>\n</div>','0',' ');
INSERT INTO `shop_site_plugins` VALUES ('11','URL Repair','','0','8','0','$tplId = (int)$tplId!=\"\"? $tplId : 1;\n$alias = explode(\"/\", $_REQUEST[\'q\']);\n$alias = end($alias);\n$alias = mysql_real_escape_string($alias);\nif(!empty($alias)){\n  $id = $modx->db->getValue($modx->db->select(\'id\', $modx->getFullTableName(\'site_content\'), \"template = \" . $tplId . \" AND alias = \'\" . $alias . \"\'\"));\n  if($id){\n    $url = $modx->makeUrl($id);\n    $modx->sendRedirect($url,0,\'REDIRECT_HEADER\',\'HTTP/1.1 301 Moved Permanently\');\n  }\n}','0','&tplId=ID шаблона;int;7','0',' ');
