INSERT INTO `shop_site_plugins` VALUES ('13','AlwaysStay','по умолчанию ставим галочку продолжить редактирование','0','1','0','//<?php\n/**\n * AlwaysStay \n * \n * по умолчанию ставим галочку продолжить редактирование\n *\n * @category    plugin\n * @version     1\n * @author		bezumkin\n * @internal    @properties\n * @internal    @installset base\n * @internal    @events OnDocFormRender,OnTempFormRender,OnChunkFormRender,OnSnipFormRender,OnPluginFormRender\n */\n\n$e = & $modx->Event;\nif(in_array($e->name, array(\"OnDocFormRender\",\"OnTempFormRender\",\"OnChunkFormRender\",\"OnSnipFormRender\",\"OnPluginFormRender\"))){\n	$e->output(\"<script type=\'text/javascript\'>if(!$(\'stay\').value) $(\'stay\').value=2;</script>\");\n}','0','','0',' ');
