INSERT INTO `shop_site_plugins` VALUES ('19','statusHistory','Ведет историю изменений статуса заказа','0','0','0','if($modx->Event->name==\'OnSHKChangeStatus\' && isset($status)){\n  \n  if(isset($_SESSION[\'mgrInternalKey\'])){\n    $mgrInternalKey = $_SESSION[\'mgrInternalKey\'];\n  }elseif($status==1){\n   $mgrInternalKey = $modx->db->getValue($modx->db->query(\"\n	SELECT\n		`u`.`internalKey`\n	FROM\n		\" . $modx->getFullTableName(\'user_attributes\') . \" `u`\n	LEFT JOIN\n		\" . $modx->getFullTableName(\'manager_shopkeeper_status_history\') . \" `h`\n			ON `h`.`mgr_id` = `u`.`internalKey`\n			AND FROM_UNIXTIME(`h`.`timestamp`,\'%Y-%m-%d\') = CURDATE()\n			AND `h`.`status_id`!=1\n	WHERE\n		`u`.`role` <3\n	GROUP BY\n		`u`.`internalKey`\n	ORDER BY \n		COUNT(`h`.`id`),\n		RAND()\n	LIMIT 1\n   \"));\n\n\n\n  }else{\n    $mgrInternalKey = 0;\n  }\n\n  $modx->db->insert(array(\n    \'order_id\'    => $order_id,\n    \'status_id\'   => $status,\n    \'mgr_id\'      => $mgrInternalKey,\n    \'timestamp\'   => time(),\n  ), $modx->getFullTableName(\'manager_shopkeeper_status_history\'));\n}','0','','0',' ');
