INSERT INTO `shop_site_snippets` VALUES ('16','WebChangePwd','<strong>1.0.1</strong> Allows Web User to change their password from the front-end of the website','0','6','0','# Created By Raymond Irving April, 2005\n#::::::::::::::::::::::::::::::::::::::::\n# Params:	\n#\n#	&tpl			- (Optional)\n#		Chunk name or document id to use as a template\n#				  \n#	Note: Templats design:\n#			section 1: change pwd template\n#			section 2: notification template \n#\n# Examples:\n#\n#	[[WebChangePwd? &tpl=`ChangePwd`]] \n\n# Set Snippet Paths \n$snipPath  = (($modx->isBackend())? \"../\":\"\");\n$snipPath .= \"assets/snippets/\";\n\n# check if inside manager\nif ($m = $modx->isBackend()) {\n	return \'\'; # don\'t go any further when inside manager\n}\n\n\n# Snippet customize settings\n$tpl		= isset($tpl)? $tpl:\"\";\n\n# System settings\n$isPostBack		= count($_POST) && isset($_POST[\'cmdwebchngpwd\']);\n\n# Start processing\ninclude_once $snipPath.\"weblogin/weblogin.common.inc.php\";\ninclude_once $snipPath.\"weblogin/webchangepwd.inc.php\";\n\n# Return\nreturn $output;\n\n\n\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('17','WebLogin','<strong>1.1.1</strong> Allows webusers to login to protected pages in the website, supporting multiple user groups','0','6','0','# Created By Raymond Irving 2004\n#::::::::::::::::::::::::::::::::::::::::\n# Params:	\n#\n#	&loginhomeid 	- (Optional)\n#		redirects the user to first authorized page in the list.\n#		If no id was specified then the login home page id or \n#		the current document id will be used\n#\n#	&logouthomeid 	- (Optional)\n#		document id to load when user logs out	\n#\n#	&pwdreqid 	- (Optional)\n#		document id to load after the user has submited\n#		a request for a new password\n#\n#	&pwdactid 	- (Optional)\n#		document id to load when the after the user has activated\n#		their new password\n#\n#	&logintext		- (Optional) \n#		Text to be displayed inside login button (for built-in form)\n#\n#	&logouttext 	- (Optional)\n#		Text to be displayed inside logout link (for built-in form)\n#	\n#	&tpl			- (Optional)\n#		Chunk name or document id to as a template\n#				  \n#	Note: Templats design:\n#			section 1: login template\n#			section 2: logout template \n#			section 3: password reminder template \n#\n#			See weblogin.tpl for more information\n#\n# Examples:\n#\n#	[[WebLogin? &loginhomeid=`8` &logouthomeid=`1`]] \n#\n#	[[WebLogin? &loginhomeid=`8,18,7,5` &tpl=`Login`]] \n\n# Set Snippet Paths \n$snipPath = $modx->config[\'base_path\'] . \"assets/snippets/\";\n\n# check if inside manager\nif ($m = $modx->isBackend()) {\n	return \'\'; # don\'t go any further when inside manager\n}\n\n# deprecated params - only for backward compatibility\nif(isset($loginid)) $loginhomeid=$loginid;\nif(isset($logoutid)) $logouthomeid = $logoutid;\nif(isset($template)) $tpl = $template;\n\n# Snippet customize settings\n$liHomeId	= isset($loginhomeid)? array_filter(array_map(\'intval\', explode(\',\', $loginhomeid))):array($modx->config[\'login_home\'],$modx->documentIdentifier);\n$loHomeId	= isset($logouthomeid)? $logouthomeid:$modx->documentIdentifier;\n$pwdReqId	= isset($pwdreqid)? $pwdreqid:0;\n$pwdActId	= isset($pwdactid)? $pwdactid:0;\n$loginText	= isset($logintext)? $logintext:\'Login\';\n$logoutText	= isset($logouttext)? $logouttext:\'Logout\';\n$tpl		= isset($tpl)? $tpl:\"\";\n\n# System settings\n$webLoginMode = isset($_REQUEST[\'webloginmode\'])? $_REQUEST[\'webloginmode\']: \'\';\n$isLogOut		= $webLoginMode==\'lo\' ? 1:0;\n$isPWDActivate	= $webLoginMode==\'actp\' ? 1:0;\n$isPostBack		= count($_POST) && (isset($_POST[\'cmdweblogin\']) || isset($_POST[\'cmdweblogin_x\']));\n$txtPwdRem 		= isset($_REQUEST[\'txtpwdrem\'])? $_REQUEST[\'txtpwdrem\']: 0;\n$isPWDReminder	= $isPostBack && $txtPwdRem==\'1\' ? 1:0;\n\n$site_id = isset($site_id)? $site_id: \'\';\n$cookieKey = substr(md5($site_id.\"Web-User\"),0,15);\n\n# Start processing\ninclude_once $snipPath.\"weblogin/weblogin.common.inc.php\";\ninclude_once ($modx->config[\'site_manager_path\'] . \"includes/crypt.class.inc.php\");\n\nif ($isPWDActivate || $isPWDReminder || $isLogOut || $isPostBack) {\n	# include the logger class\n	include_once $modx->config[\'site_manager_path\'] . \"includes/log.class.inc.php\";\n	include_once $snipPath.\"weblogin/weblogin.processor.inc.php\";\n}\n\ninclude_once $snipPath.\"weblogin/weblogin.inc.php\";\n\n# Return\nreturn $output;\n','0','&loginhomeid=Login Home Id;string; &logouthomeid=Logout Home Id;string; &logintext=Login Button Text;string; &logouttext=Logout Button Text;string; &tpl=Template;string;','');
INSERT INTO `shop_site_snippets` VALUES ('18','WebSignup','<strong>1.1.1</strong> Basic Web User account creation/signup system','0','6','0','# Created By Raymond Irving April, 2005\n#::::::::::::::::::::::::::::::::::::::::\n# Usage:     \n#    Allows a web user to signup for a new web account from the website\n#    This snippet provides a basic set of form fields for the signup form\n#    You can customize this snippet to create your own signup form\n#\n# Params:    \n#\n#    &tpl        - (Optional) Chunk name or document id to use as a template\n#	    		   If custom template AND captcha on AND using WebSignup and \n#                  WebLogin on the same page make sure you have a field named\n#                  cmdwebsignup. In the default template it is the submit button \n#                  One can use a hidden field.\n#    &groups     - Web users groups to be assigned to users\n#    &useCaptcha - (Optional) Determine to use (1) or not to use (0) captcha\n#                  on signup form - if not defined, will default to system\n#                  setting. GD is required for this feature. If GD is not \n#                  available, useCaptcha will automatically be set to false;\n#                  \n#    Note: Templats design:\n#        section 1: signup template\n#        section 2: notification template \n#\n# Examples:\n#\n#    [[WebSignup? &tpl=`SignupForm` &groups=`NewsReaders,WebUsers`]] \n\n# Set Snippet Paths \n$snipPath = $modx->config[\'base_path\'] . \"assets/snippets/\";\n\n# check if inside manager\nif ($m = $modx->isBackend()) {\n    return \'\'; # don\'t go any further when inside manager\n}\n\n\n# Snippet customize settings\n$tpl = isset($tpl)? $tpl:\"\";\n$useCaptcha = isset($useCaptcha)? $useCaptcha : $modx->config[\'use_captcha\'] ;\n// Override captcha if no GD\nif ($useCaptcha && !gd_info()) $useCaptcha = 0;\n\n# setup web groups\n$groups = isset($groups) ? array_filter(array_map(\'trim\', explode(\',\', $groups))):array();\n\n# System settings\n$isPostBack        = count($_POST) && isset($_POST[\'cmdwebsignup\']);\n\n$output = \'\';\n\n# Start processing\ninclude_once $snipPath.\"weblogin/weblogin.common.inc.php\";\ninclude_once $snipPath.\"weblogin/websignup.inc.php\";\n\n# Return\nreturn $output;','0','&tpl=Template;string;','');
INSERT INTO `shop_site_snippets` VALUES ('19','number_format','10000 => 10,000','0','8','0','\n/*\n   &int - your number\n*/\n$int=$int?$int:0;\nreturn number_format($int, 0, \",\", \",\");\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('20','currency','рубль-рубля-рублей','0','8','0','\nif($int%100<10||$int%100>19)$int=$int%10;\nswitch($int){\n  case 1: return \'рубль\'; break;\n  case 2: case 3: case 4: return \'рубля\'; break;\n  default: return \'рублей\'; break;\n}\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('21','multiPhotos','','0','8','0','\n/* \n * name - multiPhotos\n * author - Baydin Artem\n * version 1.1\n *\n */\n// Settings\nif ($modx->getChunk($tpl) != \"\")  $tpl  = $modx->getChunk($tpl);\nelse if(substr($tpl, 0, 6) == \"@CODE:\") $tpl = substr($tpl, 6);\nelse $tpl = \'<img src=\"[+src+]\" alt=\"[*pagetitle*]\"/>\';\n\n$include = isset($include) ? explode(\"||\",$include) : false;\n$exclude = isset($exclude) ? explode(\"||\",$exclude) : array();\n// End of settings\nif(empty($src)) $src=\'[]\';\n\n/* Phx Fix*/\n$phxSafeTags = array(\'&_PHX_INTERNAL_091_&\'=>\'[\',\'&_PHX_INTERNAL_093_&\'=>\']\');\n$src = str_replace(array_keys($phxSafeTags ),array_values($phxSafeTags),$src);\n\n$srcArr = json_decode($src);\nif(is_array($srcArr) && count($srcArr)>0){\n  $output=\'\';\n  foreach($srcArr as $i=>$val){\n    if(!in_array($i+1,$exclude) && (!is_array($include) || in_array($i+1,$include))){\n      $val = empty($val)? \'images/ico/nophoto.png\' : $val;\n      $output.= str_replace(\"[+src+]\",$val,$tpl);\n    }\n  }\n}\nelse $output = str_replace(\"[+src+]\",\"assets/images/products/no-photo.svg\",$tpl);\n\nreturn $output;\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('22','Shopkeeper','<strong>1.3.4</strong> Shopping cart for MODx Evolution','0','10','0','$output = \'\';\n\nrequire MODX_BASE_PATH.\"assets/snippets/shopkeeper/shopkeeper.inc.php\";\n\nreturn $output;\n\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('23','htmlentities','php функция htmlentities($str);','0','8','0','\nreturn htmlentities($str);\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('24','WebLoginPE','<b>1.3.1</b> Bugfix by Soshite @ MODx CMS Forums & Various Other Forum Members','0','6','0','\n/**\n	 * WebLoginPE Snippet 1.3.1\n	 * v1.3.1 Bugfix by Soshite @ MODx CMS Forums & Various Other Forum Members\n	 *\n	 * @package WebLoginPE\n	 * @author Scotty Delicious\n	 * @version 1.3.1\n	 *\n	 * See the \"docs\" folder for detailed usage and parameter instructions.\n	 */\n\n	$type = isset($type) ? $type : \'simple\';\n	$regType = isset($regType) ? $regType : \'instant\';\n	$notify = isset($notify) ? $notify : \'\';\n	$groups = isset($groups) ? $groups : \'\';\n	$regRequired = isset($regRequired) ? $regRequired : \'\';\n	$customTable = isset($customTable) ? $customTable : \'web_user_attributes_extended\';\n	$customFields = isset($customFields) ? $customFields : \'\';\n	$prefixTable = isset($prefixTable) ? $prefixTable : 1;\n	$lang = isset($lang) ? $lang : \'ru\';\n	$userImageSettings = isset($userImage) ? $userImage : \'105000,100,100\';\n	$dateFormat = isset($dateFormat) ? $dateFormat : \'%A %B %d, %Y at %I:%M %p\';\n	$disableServices = isset($disableServices) ? explode(\',\', str_replace(\', \',\',\',$disableServices)) : array();\n	$tableCheck = isset($tableCheck) ? $tableCheck : 1;\n	\n	include_once MODX_BASE_PATH.\'assets/snippets/webloginpe/webloginpe.class.php\';\n	include MODX_BASE_PATH.\'assets/snippets/webloginpe/webloginpe.templates.php\';\n	if (file_exists(MODX_BASE_PATH.\'assets/snippets/webloginpe/lang/\'.$lang.\'.php\'))\n	{\n		include_once MODX_BASE_PATH.\'assets/snippets/webloginpe/lang/\'.$lang.\'.php\';\n	}\n	else\n	{\n		include_once MODX_BASE_PATH.\'assets/snippets/webloginpe/lang/ru.php\';\n		$modx->setPlaceholder(\'wlpe.message\', $wlpe_lang[105]);\n		print \'[+wlpe.message+]\';\n	}\n	\n	$wlpe = new WebLoginPE($wlpe_lang, $dateFormat, $userImageSettings, $type);\n	$wlpe->CustomTable($customTable, $customFields, $prefixTable, $tableCheck);\n\n	$liHomeId = isset($liHomeId) ? explode(\',\', $liHomeId) : \'\';\n	$loHomeId = isset($loHomeId) ? $loHomeId : \'\';\n	$regHomeId = isset($regHomeId) ? $regHomeId : \'\';\n	$regSuccessId = isset($regSuccessId) ? $regSuccessId : \'\';\n	$regSuccessPause = isset($regSuccessPause) ? $regSuccessPause : 5;\n	$profileHomeId = isset($profileHomeId) ? $profileHomeId : \'\';\n	$inputHandler = isset($inputHandler) ? explode(\'||\', $inputHandler) : array();\n	$usersList = isset($usersList) ? $usersList : \'\';\n	\n	if ($regType == \'verify\'){$wlpeRegisterTpl = $wlpeRegisterVerifyTpl;}else{$wlpeRegisterTpl = $wlpeRegisterInstantTpl;}\n	\n	$displayLoginFormTpl = isset($loginFormTpl) ? $wlpe->Template($loginFormTpl) : $wlpeDefaultFormTpl;\n	$displaySuccessTpl = isset($successTpl) ? $wlpe->Template($successTpl) : $wlpeDefaultSuccessTpl;\n	$displayRegisterTpl = isset($registerTpl) ? $wlpe->Template($registerTpl) : $wlpeRegisterTpl;\n	$displayRegSuccessTpl = isset($registerSuccessTpl) ? $wlpe->Template($registerSuccessTpl) : $wlpeDefaultFormTpl;\n	$displayProfileTpl = isset($profileTpl) ? $wlpe->Template($profileTpl) : $wlpeProfileTpl;\n	$displayViewProfileTpl = isset($viewProfileTpl) ? $wlpe->Template($viewProfileTpl) : $wlpeViewProfileTpl;\n	$displayUsersOuterTpl = isset($usersOuterTpl) ? $wlpe->Template($usersOuterTpl) : $wlpeUsersOuterTpl;\n	$displayUsersTpl = isset($usersTpl) ? $wlpe->Template($usersTpl) : $wlpeUsersTpl;\n	$displayManageOuterTpl = isset($manageOuterTpl) ? $wlpe->Template($manageOuterTpl) : $wlpeUsersOuterTpl;\n	$displayManageTpl = isset($manageTpl) ? $wlpe->Template($manageTpl) : $wlpeManageTpl;\n	$displayManageProfileTpl = isset($manageProfileTpl) ? $wlpe->Template($manageProfileTpl) : $wlpeManageProfileTpl;\n	$displayManageDeleteTpl = isset($manageDeleteTpl) ? $wlpe->Template($manageDeleteTpl) : $wlpeManageDeleteTpl;\n	$displayProfileDeleteTpl = isset($profileDeleteTpl) ? $wlpe->Template($profileDeleteTpl) : $wlpeProfileDeleteTpl;\n	$displayActivateTpl = isset($activateTpl) ? $wlpe->Template($activateTpl) : $wlpeActivateTpl;\n	$displayResetTpl = isset($resetTpl) ? $wlpe->Template($resetTpl) : $wlpeResetTpl;\n	$notifyTpl = isset($notifyTpl) ? $wlpe->Template($notifyTpl) : $wlpeNotifyTpl;\n	$notifySubject = isset($notifySubject) ? $notifySubject : \'New Web User for \'.$modx->config[\'site_name\'].\'.\';\n	$messageTpl = isset($messageTpl) ? $wlpe->Template($messageTpl) : $wlpeMessageTpl;\n	$tosChunk = isset($tosChunk) ? $wlpe->Template($tosChunk) : $wlpeTos;\n	$modx->setPlaceholder(\'tos\', $tosChunk);\n	\n	$loadJquery = isset($loadJquery) ? $loadJquery : false;\n	$customJs = isset($customJs) ? $customJs : \'\';\n	\n	if (isset($pruneDays))\n	{\n		$wlpe->PruneUsers($pruneDays);\n	}\n		\n	if ($loadJquery == \'true\' || $loadJquery == true || $loadJquery == 1 || $loadJquery == \'1\') \n	{\n		$wlpe->RegisterScripts($customJs);\n	}\n	else if (!empty($customJs))\n	{\n		$modx->regClientStartupScript($customJs);\n	}\n	\n	$wlpe->ActiveUsers();\n	$wlpe->PlaceHolders($inputHandler, $messageTpl);\n	\n	$modx->regClientStartupScript(\'assets/snippets/webloginpe/js/ieButtonFix.js\');\n\n	$service = $_REQUEST[\'service\'];\n	if (empty($service) || $service == \'\')\n	{\n		$service = $_REQUEST[\'serviceButtonValue\'];\n	}\n	\n	if ($type == \'register\')\n	{\n		if (in_array(\'register\', $disableServices)){return;}\n		switch ($service) \n		{\n			case \'register\' :\n				if (in_array(\'register\', $disableServices)){return;}\n				$registration = $wlpe->Register($regType, $groups, $regRequired, $notify, $notifyTpl, $notifySubject);\n				\n				if (isset($regSuccessId) && $regSuccessId !== \'\')\n				{\n					if ($registration == \'success\')\n					{\n						$url = rtrim($modx->config[\'site_url\'], \'/\').$modx->makeURL($regSuccessId);\n						header(\'Refresh: \'.$regSuccessPause.\';URL=\'.$url);\n						return $displayRegSuccessTpl;\n					}\n					return $displayRegisterTpl;\n					\n				}\n				if ($registration == \'success\')\n				{\n					return $displayRegSuccessTpl;\n				}\n				return $displayRegisterTpl;\n				break;\n				\n			case \'cancel\':\n				if ($loHomeId == \'\') $loHomeId = $modx->config[\'site_start\'];\n				$url = $modx->makeURL($loHomeId);\n		        $modx->sendRedirect($url,0,\'REDIRECT_REFRESH\');\n				break;\n			\n			case \'login\' :\n				$wlpe->Login($type, $liHomeId);\n\n				if ($modx->getLoginUserID())\n				{\n					return $displaySuccessTpl;\n				}\n				return $displayLoginFormTpl;\n				break;\n\n			case \'logout\' :\n				$wlpe->Logout($type, $loHomeId);\n				return $displayLoginFormTpl;\n				break;\n			\n			default :\n				return $displayRegisterTpl;\n		}\n		return;\n	}\n	\n	else if ($type == \'profile\')\n	{\n		if (in_array(\'profile\', $disableServices)){return;}\n		switch ($service) \n		{\n			case \'saveprofile\' :\n				if (in_array(\'saveprofile\', $disableServices)){return;}\n				$wlpe->SaveUserProfile();\n				$wlpe->PlaceHolders($inputHandler, $messageTpl);\n				return $displayProfileTpl;\n				break;\n				\n			case \'cancel\':\n				if ($loHomeId == \'\') $loHomeId = $modx->config[\'site_start\'];\n				$url = $modx->makeURL($loHomeId);\n		        $modx->sendRedirect($url,0,\'REDIRECT_REFRESH\');\n				break;\n				\n			case \'logout\':\n				if ($loHomeId == \'\') $loHomeId = $modx->config[\'site_start\'];\n				$wlpe->Logout($type, $loHomeId);\n				break;\n				\n			case \'deleteprofile\':\n				if (in_array(\'deleteprofile\', $disableServices)){return;}\n				return $displayProfileDeleteTpl;\n				break;\n			\n			case \'confirmdeleteprofile\':\n				if (in_array(\'confirmdeleteprofile\', $disableServices)){return;}\n				$wlpe->RemoveUserProfile();\n				return \'[+wlpe.message+]\';\n				break;\n				\n			default :\n				return $displayProfileTpl;\n				break;\n		}\n		return;\n	}\n	\n	else if ($type == \'users\')\n	{\n		if (in_array(\'users\', $disableServices)){return;}\n		switch ($service)\n		{\n			case \'viewprofile\':\n				if (in_array(\'viewprofile\', $disableServices)){return;}\n				$wlpe->ViewUserProfile($_REQUEST[\'username\'],$inputHandler);\n				return $displayViewProfileTpl;\n				break;\n				\n			case \'messageuser\':\n				if (in_array(\'messageuser\', $disableServices)){return;}\n				$wlpe->SendMessageToUser();\n				return $displayViewProfileTpl;\n				break;\n			\n			default :\n				$userpage = $wlpe->ViewAllUsers($displayUsersTpl, $displayUsersOuterTpl, $usersList);\n				return $userpage;\n		}\n		return;\n	}\n	\n	else if ($type == \'manager\')\n	{\n		if (in_array(\'manager\', $disableServices)){return;}\n		switch ($service)\n		{\n			case \'editprofile\':\n				if (in_array(\'editprofile\', $disableServices)){return;}\n				$wlpe->ViewUserProfile($_REQUEST[\'username\'],$inputHandler);\n				return $displayManageProfileTpl;\n				break;\n				\n			case \'saveuserprofile\' :\n				if (in_array(\'saveuserprofile\', $disableServices)){return;}\n				$wlpe->SaveUserProfile($_POST[\'internalKey\']);\n				$manageUsersPage = $wlpe->ViewAllUsers($displayManageTpl, $displayManageOuterTpl, $usersList);\n				return $manageUsersPage;\n				break;\n				\n			case \'messageuser\':\n				if (in_array(\'messageuser\', $disableServices)){return;}\n				$wlpe->SendMessageToUser();\n				return $displayViewProfileTpl;\n				break;\n				\n			case \'deleteuser\':\n				if (in_array(\'deleteuser\', $disableServices)){return;}\n				$_SESSION[\'editInternalKey\'] = $_POST[\'internalKey\'];\n				return $displayManageDeleteTpl;\n				break;\n\n			case \'confirmdeleteuser\':\n				if (in_array(\'confirmdeleteuser\', $disableServices)){return;}\n				$wlpe->RemoveUserProfileManager($_SESSION[\'editInternalKey\']);\n				$manageUsersPage = $wlpe->ViewAllUsers($displayManageTpl, $displayManageOuterTpl, $usersList);\n				unset($_SESSION[\'editInternalKey\']);\n				return $manageUsersPage;\n				break;\n			\n			default :\n				$manageUsersPage = $wlpe->ViewAllUsers($displayManageTpl, $displayManageOuterTpl, $usersList);\n				return $manageUsersPage;\n		}\n		return;\n	}\n	\n	else if ($type == \'simple\')\n	{\n		switch ($service) \n		{\n\n			case \'login\' :\n				$wlpe->Login($type, $liHomeId);\n\n				if ($modx->getLoginUserID())\n				{\n					return $displaySuccessTpl;\n				}\n				return $displayLoginFormTpl;\n				break;\n\n			case \'logout\' :\n				$wlpe->Logout($type, $loHomeId);\n				return $displayLoginFormTpl;\n				break;\n\n			case \'profile\' :\n				if (in_array(\'profile\', $disableServices)){return;}\n				if (empty($profileHomeId))\n				{\n					return $displayProfileTpl;\n				}\n				$url = $modx->makeURL($profileHomeId);\n		        $modx->sendRedirect($url,0,\'REDIRECT_REFRESH\');\n		        return;\n				break;\n				\n			case \'saveprofilesimple\' :\n				if (in_array(\'saveprofile\', $disableServices)){return;}\n				$wlpe->SaveUserProfile();\n				$wlpe->PlaceHolders($inputHandler, $messageTpl);\n				return $displayProfileTpl;\n				break;\n			\n			case \'deleteprofilesimple\':\n				if (in_array(\'deleteprofile\', $disableServices)){return;}\n				return $displayProfileDeleteTpl;\n				break;\n\n			case \'confirmdeleteprofilesimple\':\n				if (in_array(\'confirmdeleteprofile\', $disableServices)){return;}\n				$wlpe->RemoveUserProfile();\n				return \'[+wlpe.message+]\';\n				break;\n\n			case \'registernew\' :\n				if (in_array(\'register\', $disableServices)){return;}\n				if (empty($regHomeId))\n				{\n					return $displayRegisterTpl;\n				}\n				$url = $modx->makeURL($regHomeId);\n		        $modx->sendRedirect($url,0,\'REDIRECT_REFRESH\');\n		        return;\n				break;\n				\n			case \'register\':\n				if (in_array(\'register\', $disableServices)){return;}\n				$registration = $wlpe->Register($regType, $groups, $regRequired, $notify, $notifyTpl, $notifySubject);\n				\n				if (isset($regSuccessId) && $regSuccessId !== \'\')\n				{\n					if ($registration == \'success\')\n					{\n						$url = rtrim($modx->config[\'site_url\'], \'/\').$modx->makeURL($regSuccessId);\n						header(\'Refresh: \'.$regSuccessPause.\';URL=\'.$url);\n						return $displayRegSuccessTpl;\n					}\n					return $displayRegisterTpl;\n					\n				}\n				if ($registration == \'success\')\n				{\n					return $displayRegSuccessTpl;\n				}\n				return $displayRegisterTpl;\n				break;\n\n			case \'forgot\' :\n				if (in_array(\'forgot\', $disableServices)){return;}\n				return $displayResetTpl;\n				break;\n			\n			case \'resetpassword\' :\n				if (in_array(\'resetpassword\', $disableServices)){return;}\n				$wlpe->ResetPassword();\n				if (isset($wlpe->Report)) \n				{\n					if (isset($_POST[\'email\']))\n					{\n						return $displayResetTpl;\n					}\n					else\n					{\n						return $displayActivateTpl;\n					}\n				}\n				return;\n				break;\n			\n			case \'activate\' :\n				if (in_array(\'activate\', $disableServices)){return;}\n				return $displayActivateTpl;\n				break;\n			\n			case \'activated\':\n                if (in_array(\'activated\', $disableServices)){return;}\n                $wlpe->ActivateUser();\n                // pixelchutes 1:57 AM 9/19/2007\n                // Here we check for an error, then reload the activation template if necessary\n                // Do NOT reload if wlpe->Report indicates success\n                 // Added strip_tags() around string which means an error is not thrown regarding a modifier from closing\n                // html tag e.g. if $wlpe_lang[104] contains \"</div>\" this will fail as \"/d\" treated as modifier\n                if ( isset( $wlpe->Report ) && !preg_match( \"/\".strip_tags($wlpe_lang[104]).\"/i\", $wlpe->Report ) )\n                {\n                    return $displayActivateTpl;\n                }                \n                return $displayLoginFormTpl;\n                break;\n			\n			default :\n				\n				if ($modx->getLoginUserID())\n				{\n					return $displaySuccessTpl;\n				}\n				else\n				{\n					$wlpe->AutoLogin();\n					return $displayLoginFormTpl;\n				}\n\n		}// [END] Switch : $service for simple.\n	}\n	\n	else if ($type == \'taconite\')\n	{\n		switch ($service) \n		{\n\n			case \'login\' :\n				$wlpe->Login($type, $liHomeId);\n\n				if (isset($wlpe->Report)) \n				{\n					return $wlpe->Report;\n				}\n				return;\n				break;\n\n			case \'logout\' :\n				$wlpe->Logout($type, $loHomeId);				\n				return;\n				break;\n\n			case \'register\' :\n				if (in_array(\'register\', $disableServices)){return;}\n				$wlpe->Register($regType, $groups, $regRequired, $notify, $notifyTpl, $notifySubject);\n				return $wlpe->Report;\n				break;\n			\n			case \'resetpassword\' :\n				if (in_array(\'resetpassword\', $disableServices)){return;}\n				$wlpe->ResetPassword();\n				return $wlpe->Report;\n				break;\n				\n			case \'activated\':\n				if (in_array(\'activated\', $disableServices)){return;}\n				$wlpe->ActivateUser();\n				return $wlpe->Report;\n				break;\n					\n			default :\n				if ($modx->getLoginUserID())\n				{\n					return;\n				}\n				else\n				{\n					$wlpe->AutoLogin();\n				}\n		}// [END] Switch : $service for taconite.\n	}\n	\n	else\n	{\n		return;\n	}\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('25','seoRobots','Управляет индексацией страницы. (В виде плагина кешируется)','0','11','0','\nif($modx->documentObject[\'searchable\']==0 || count(array_diff(array_keys($_GET),explode(\",\", str_replace(\" \",\"\",$ignoreget))))>0){\n	header(\"HTTP/1.0 404 Not Found\");\n	$modx->setPlaceholder(\'robots\', \'noindex, nofollow\');\n}else{\n	$modx->setPlaceholder(\'robots\', \'index, follow\');\n}\n','0','','');
INSERT INTO `shop_site_snippets` VALUES ('26','phone','','0','0','0','\n\nif(empty($limit)) $limit=1;\nif($modx->getChunk($tpl) != \"\") $tpl = $modx->getChunk($tpl);\nelseif(substr($tpl, 0, 6) == \"@CODE:\") $tpl = substr($tpl, 6);\nelse $tpl = \'[+phone+]\';\n	\n$users = $modx->db->makeArray($modx->db->select(\"*\", $modx->getFullTableName(\'user_attributes\'), \"role<3\", \"RAND()\", $limit));\n\n$output=\"\";\nforeach($users as $user){\n	$output.= str_replace(\"[+phone+]\", $user[\'phone\'], $tpl);\n}\n\nreturn $output;\n','0','','');
