INSERT INTO `shop_site_templates` VALUES ('7','Product','Товар','0','0','','0','{{head}}\n<section id=\'content\'>\n	{{catalog-menu}}\n	<section id=\'item\'>\n		<figure>\n			<aside style=\'background-image:url(\"[[multiPhotos? &include=`1` &src=`[*image*]` &tpl=`@CODE:[+src+]`]]\")\'>[[if? \n				&is=`[*image*]:!=:[]` &then=`\n					<a data-group=\"item\" class=\'fancybox-thumb\' href=\'[[multiPhotos? &include=`1` &src=`[*image*]` &tpl=`@CODE:[+src+]`]]\'>\n						<img src=\'[[multiPhotos? &include=`1` &src=`[*image*]` &tpl=`@CODE:[+src+]`]]\'/>\n					</a>\n					<div class=\'thumbs\'>\n						[[multiPhotos? &src=`[*image*]` &exclude=`1` \n							&tpl=`@CODE:<a data-group=\"item\" class=\'fancybox-thumb\' href=\'[+src+]\'><img src=\'thumbs/64x64/[+src+]\' alt=\'[*pagetitle*]\'/></a>`\n						]]\n					</div>\n				`]]\n			</aside>\n			<figcaption>\n				<h1>[*pagetitle*]<span class=\'id\'>Артикул: [*alias*]</span></h1>\n	            <form action=\"[~[*id*]~]\" method=\"post\">\n				  <input type=\"hidden\" name=\"shk-id\" value=\"[*id*]\" />\n				  <input type=\"hidden\" name=\"shk-name\" value=\"[*pagetitle*]\" />\n				  <input type=\"hidden\" name=\"shk-count\" value=\"1\" />\n					<div class=\'price\'>\n						<div>[!if? &is=`[*newprice*]:!empty` \n							&then=`<s>[[number_format?&int=`[*price*]`]] руб.</s> [[number_format?&int=`[*newprice*]`]]<span class=\'currency\'>[[currency?&int=`[*newprice*]`]]</span>`\n							&else=`[[number_format?&int=`[*price*]`]]<span class=\'currency\'>[[currency?&int=`[*price*]`]]</span>`\n						!]</div>\n					</div>\n					<button type=\'submit\' class=\"cart-icon\">В корзину<small>добавить</small></button>\n				</form>\n				<div class=\'clear\'></div>\n				<div class=\'grid2\'>\n					<ul>\n						<li>\n							<p class=\'oneclick\'><a style=\'color:#000;\' href=\'#\' onclick=\'return false;\'><!--i></i--><span>Купить в 1 клик</span></a>\n								<!--span><input type=\'text\'/><button>Купить</button></span-->\n							</p>\n							<p class=\'description\'><a href=\'#description\'><!--i></i--><span>Характеристики</span></a></p>\n							<p class=\'reviews\'><a href=\'#reviews\'><!--i></i--><span>Отзывы</span></a></p>\n							<p class=\'related\'><a href=\'#related\'><!--i></i--><span>Сопутствующие товары</span></a></p>\n						</li>\n						<li>\n							<p>Наличие: выше среднего</p>\n							<p>Доставка: Суббота, 7 февраля</p>\n							<p>Самовывоз: Суббота, 7 февраля</p>\n						</li>\n					</ul>\n				</div>            \n			</figcaption>\n			\n		</figure>\n	</section>\n	<section id=\'item_description\'>\n		\n		\n		<a name=\'description\'></a>\n		<div class=\'grid2\'>\n			<ul>\n				<li>\n					[[if?&is=`[*introtext*]:!empty` &then=`<p><b>[*pagetitle*]</b> – [*introtext*]</p>`]]\n					[*content*]\n					<br/>\n					<figure class=\'review\'>\n						<p>Заказывала <a href=\'.\'>декантер для вина</a>. Вежливые менеджеры, быстро связались, доставили в срок. Все товары хорошего качества.</p>\n						<a href=\'#reviews\'>Все отзывы</a>\n						<figcaption>Байдин Артем</figcaption>\n					</figure>\n				</li>\n				<li>\n					<h4><b>Информация о товаре</b></h4>\n					<table>\n						<tr><th><span>Артикул</span></th><td>[*alias*]</td></tr>\n						[[if?&is=`[*attr_brand*]:!empty` &then=`<tr><th><span>Производитель</span></th><td>[*brand*]</td></tr>`]]\n						[[if?&is=`[*attr_series*]:!empty` &then=`<tr><th><span>Серия</span></th><td>[*series*]</td></tr>`]]\n						[[if?&is=`[*attr_color*]:!empty` &then=`<tr><th><span>Цвет</span></th><td>[*color*]</td></tr>`]]\n						[[if?&is=`[*attr_height*]:!empty` &then=`<tr><th><span>Высота</span></th><td>[*height*]</td></tr>`]]\n						[[if?&is=`[*attr_width*]:!empty` &then=`<tr><th><span>Ширина</span></th><td>[*width*]</td></tr>`]]\n						[[if?&is=`[*attr_depth*]:!empty` &then=`<tr><th><span>Глубина</span></th><td>[*depth*]</td></tr>`]]\n					</table>\n					<br/>\n					<p><a href=\'#\' class=\'warrantly\'><span>Гарантия TTstore<small>только в нашем магазине</small></span></a></p>\n				</li>\n			</ul>\n		</div>     \n	</section>    \n	<section class=\'items carousel\'>\n		<a name=\'related\'></a>\n		<h2><a href=\'\'>С \"[*pagetitle*]\" часто покупают:</a></h2>\n		<ul>\n			<li><figure>\n				<img src=\'assets/images/02934_0.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/c81155.jpg\'/>\n				<figcaption><a href=\'\'>Ящик ПРИНЦЕССЫ/ФЕИ DISNEY 15л</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/G0670_0.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/tal1083.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/TAL1606.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/BK-8A.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/BK-8A.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure></li>\n			<li><figure>\n				<img src=\'assets/images/BK-8A.jpg\'/>\n				<figcaption><a href=\'\'>Ящик для инструментов 20 PREMIUM 51х26х25см (7702)</a><span class=\'price\'><s>1349 р.</s> 1063 р.</span></figcaption>\n				</figure><